def schwefel(vector: np.ndarray):
    return -418.9829 * vector.size + np.sum(vector * np.sin(np.sqrt(np.abs(vector))))

def max_sqrt_abs(vector: np.ndarray):
    return np.sqrt(np.abs(vector)).max()

def find_min(dim, tot_points_per_core):
    act_min = -float('inf')
    feasible = 0

    vals = [np.array(v) for v in values[:dim]]

    for _ in range(tot_points_per_core):
        x = np.array([np.random.choice(v) for v in vals])

        if g(x) <= constr_values[dim]:
            feasible += 1
            fx = f(x)
            if fx > act_min:
                act_min = fx

    return -act_min, feasible

def run_parallel(dim, tot_points, n_runs=os.cpu_count()):
    
    with ProcessPoolExecutor() as executor:
        results = list(executor.map(find_min, [dim]*n_runs, [tot_points]*n_runs))
    
    act_mins, feasibles = zip(*results)
    
    final_min = min(act_mins)
    avg_feasible = np.mean(feasibles) / tot_points * 100

    print(f"Final Act min: {final_min}, Avg Feasible: {avg_feasible:.2f}%")
    return final_min, avg_feasible

def run_dMALIBOO(f, pbounds, seed, output_path, adaptive_method, acq, kernel, ml_on_bounds, ml_on_target, epsilon_greedy, ml_bounds_type, ml_model, ml_target_type, ml_target_model, eps_greedy_prob, values):

    optimizer = BO(f=f, pbounds=pbounds, random_state=seed, output_path=output_path, values=values, verbose=0)

    acquisition_info = {
        'ml_target': max_sqrt_abs,
        'ml_bounds': (0, constr_values[dim]),
        'ml_bounds_coeff': [0.9, None],
        'ml_bounds_type': ml_bounds_type,
        'ml_bounds_model': ml_model,
        'ml_bounds_alpha': 1.0,
        'ml_target_type': ml_target_type,
        'ml_target_model': ml_target_model,
        'ml_target_coeff': [1.111, None],
        'ml_target_alpha': 1.0,
        'eps_greedy_random_prob': eps_greedy_prob,
        'ml_bounds_gamma': 0.1,
        'ml_target_gamma': 0.1,
        'ml_bounds_n_estimators': 100,
        'ml_bounds_max_depth': None,
        'ml_target_n_estimators': 100,
        'ml_target_max_depth': None,
        'ml_bounds_activation': 'relu',
        'ml_bounds_solver': 'adam',
        'ml_bounds_learning_rate': 0.01,
        'ml_bounds_max_iter': int(1e6),
        'ml_target_activation': 'relu',
        'ml_target_solver': 'adam',
        'ml_target_learning_rate': 0.01,
        'ml_target_max_iter': int(1e6)
    }
    
    if adaptive_method:
        if acq == 'ucb':
            acquisition_info['initial_beta'] = 1.0
            acquisition_info['beta_h'] = 10.0

        acquisition_info['DBO_kernel'] = kernel

        if kernel == 'RBF':
            acquisition_info['initial_l'] = 1.0
            acquisition_info['l_h'] = 10.0
            acquisition_info['sigma_2'] = 1.0

        elif kernel == 'Matern':
            acquisition_info['initial_nu'] = 2.5
            acquisition_info['nu_h'] = 10.0

        else:
            print("ERROR...")

    optimizer.maximize(init_points=10, 
                       initial_points_selection_method='sobol',
                       n_iter=200, 
                       acq=acq,
                       ml_on_bounds=ml_on_bounds, 
                       ml_on_target=ml_on_target,
                       epsilon_greedy=epsilon_greedy,
                       adaptive_method=adaptive_method,
                       memory_queue_len=1000, 
                       acq_info=acquisition_info,
                       stop_crit_info={}, 
                       relaxation=False,
                       consider_max_only_on_feasible=True)
    
    perc_feasibility = mean(optimizer._space.feasibility)*100
    print(f"Regret: {abs(-optimizer.max['target'] - best_values[dim])/best_values[dim]*100} %, Feasibility: {perc_feasibility} %")

    return -optimizer.max['target'], perc_feasibility

def run_single(setting, idx, seeds, output_path, schwefel, pbounds, values, dim):
    output_path_tmp = output_path + f"/{setting['ml_on_bounds']}/{setting['ml_on_target']}/{setting['epsilon_greedy']}/{setting['ml_bounds_type']}/{setting['ml_model']}/{setting['ml_target_type']}/{setting['ml_target_model']}/{setting['eps_greedy_prob']}/{idx}"
    
    start_time = time()
    result, perc_feasibility = run_dMALIBOO(
        schwefel, pbounds, int(seeds[idx]), output_path=output_path_tmp,
        adaptive_method=False, acq='ei', kernel='Matern',
        ml_on_bounds=setting["ml_on_bounds"],
        ml_on_target=setting["ml_on_target"],
        epsilon_greedy=setting["epsilon_greedy"],
        ml_bounds_type=setting['ml_bounds_type'],
        ml_model=setting['ml_model'],
        ml_target_type=setting['ml_target_type'],
        ml_target_model=setting['ml_target_model'],
        eps_greedy_prob=setting['eps_greedy_prob'],
        values=values[:dim]
    )
    elapsed = time() - start_time
    return idx, result, perc_feasibility, elapsed

